//import logo from './logo.svg';
import React from 'react';
import Navbar from "react-bootstrap/Navbar";
import Nav from 'react-bootstrap/Nav';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import CreateStudent from "./component/create-student.component";
import EditStudent from "./component/edit-student.component";
import StudentList from "./component/student-list.component";


function App() {
  return (
    <div className="App">
      <Router>
        <header className="App-header">

          <Navbar bg="primary" variant="dark">
            <Container>
              <Navbar.Brand>
                <Link to={"/student-list"} className="nav-link" >

                <svg xmlns="http://www.w3.org/2000/svg" width="30" height="30" fill="currentColor" class="bi bi-thermometer-sun" viewBox="0 0 16 16">
                <path d="M5 12.5a1.5 1.5 0 1 1-2-1.415V2.5a.5.5 0 0 1 1 0v8.585A1.5 1.5 0 0 1 5 12.5z"/>
                <path d="M1 2.5a2.5 2.5 0 0 1 5 0v7.55a3.5 3.5 0 1 1-5 0V2.5zM3.5 1A1.5 1.5 0 0 0 2 2.5v7.987l-.167.15a2.5 2.5 0 1 0 3.333 0L5 10.486V2.5A1.5 1.5 0 0 0 3.5 1zm5 1a.5.5 0 0 1 .5.5v1a.5.5 0 0 1-1 0v-1a.5.5 0 0 1 .5-.5zm4.243 1.757a.5.5 0 0 1 0 .707l-.707.708a.5.5 0 1 1-.708-.708l.708-.707a.5.5 0 0 1 .707 0zM8 5.5a.5.5 0 0 1 .5-.5 3 3 0 1 1 0 6 .5.5 0 0 1 0-1 2 2 0 0 0 0-4 .5.5 0 0 1-.5-.5zM12.5 8a.5.5 0 0 1 .5-.5h1a.5.5 0 1 1 0 1h-1a.5.5 0 0 1-.5-.5zm-1.172 2.828a.5.5 0 0 1 .708 0l.707.708a.5.5 0 0 1-.707.707l-.708-.707a.5.5 0 0 1 0-.708zM8.5 12a.5.5 0 0 1 .5.5v1a.5.5 0 0 1-1 0v-1a.5.5 0 0 1 .5-.5z"/></svg>Laboratorio Henrry Montañez</Link>
              </Navbar.Brand>

                <Nav className = "justify-content-end" > 

                <Nav>
                  <Link to = {"/student-list"} className = "nav-link" >

                  </Link>
                </Nav>

                <Nav>
                  <Link to = {"/edit-student"} className = "nav-link" >
                    Conocenos
                  </Link>
                </Nav>

                <Nav>
                  <Link to = {"#!"} className = "nav-link" >

                  </Link>
                </Nav>

              </Nav>
            </Container>
          </Navbar>
        </header> 
        <Container>
          <Row>
            <Col md={12}>
              <div className="wrapper">
                <Switch>
                  <Route
                    exact
                    path="/"
                    component={(props) =><CreateStudent{...props} />}
                  />
                  <Route
                    exact
                    path="/create-student"
                    component={(props) =><CreateStudent{...props} />}
                  />
                  <Route
                    exact
                    path="/edit-student/:id"
                    component={(props) =><EditStudent{...props} />}
                  />
                  <Route
                    exact
                    path="/student-list"
                    component={(props) =><StudentList{...props} />}
                  />
                </Switch>
              </div>
            </Col>
          </Row>
        </Container> 
      </Router> 
    </div>
  );
}

export default App;
